import React from 'react'
import { ProfileSide } from '../../Components/ProfileSide/ProfileSide'
import './Home.css'

const Home = () => {
  return (
    <div className="Home">
        <ProfileSide/>
        <div className="Posts">Posts</div>
        <div className="Right">RightSide</div>
    </div>
  )
}

export default Home
